control.onControlLoad:
//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
if (!g5.tableClick.valid) {
    alert("请选择有效的记录进行操作");
    return;
}
var userId = query.dataset.getData(0,g5.tableClick.y);
var status = query.dataset.getData(1,g5.tableClick.y);
if (status == "DISABLED") {
    if (!confirm("该用户处于封号状态，是否进行解封操作？")) {
        return;
    }
    if (disableUser.busy) return;
    disableUser.userId = userId;
    disableUser.operation = "0";
    disableUser.onComplete = function() {
        query();
    }
    disableUser();
} else if (status == "IDL") {
    if (!confirm("该用户处于正常状态，是否进行封号操作？")) {
        return;
    }
    if (disableUser.busy) return;
    disableUser.userId = userId;
    disableUser.operation = "1";
    disableUser.onComplete = function() {
        query();
    }
    disableUser();
}

if (!g5.tableClick.valid) {
    alert("请选择有效的记录进行操作");
    return;
}
var userId = query.dataset.getData(0,g5.tableClick.y);
var status = query.dataset.getData(1,g5.tableClick.y);
if (status == "FREEZE") {
    if (!confirm("该用户处于冻结状态，是否将其恢复为正常状态？")) {
        return;
    }
    if (freezeUser.busy) return;
    freezeUser.userId = userId;
    freezeUser.operation = "0";
    freezeUser.onComplete = function() {
        query();
    }
    freezeUser();
} else if (status == "IDL") {
    if (!confirm("该用户处于正常状态，是否进行冻结？")) {
        return;
    }
    if (freezeUser.busy) return;
    freezeUser.userId = userId;
    freezeUser.operation = "1";
    freezeUser.onComplete = function() {
        query();
    }
    freezeUser();
}

if (!g5.tableClick.valid) {
    alert("请选择有效的记录进行操作");
    return;
}
var userId = query.dataset.getData(0,g5.tableClick.y);
var status = query.dataset.getData(1,g5.tableClick.y);
if (!confirm("本操作不可逆，您确定要删除该用户所有的关注状态吗？完成后该用户的关注将变为0")) {
    return;
}
if (delFollow.busy) return;
delFollow.userId = userId;
delFollow.onComplete = function(result) {
    alert("操作完成：" + result);
    query();
}
delFollow();

